import Button from "../Button/Button";
import "./Card.css";

function Card( {name, precio, imgurl, descripcion} ) {

    const dataProducts = [
        {
            id: 1,
            name: "Boston Celtics",
            precio: 122,
            imgurl: "https://picsum.photos/200/300",
            descripcion: "NBA jerseys",
            stock: 7,
            },
            {
                id: 2,
                name: "Golden State Warriors",
                imgurl: "https://picsum.photos/200/300",
                precio: 134,
                descripcion: "NBA jerseys",
                stock: 7,
            },
            {
                id: 3,
                name: "Lakers",
                imgurl: "https://picsum.photos/200/300",
                precio: 180,
                descripcion: "NBA jerseys",
                stock: 7,
            },
            {
                id: 4,
                name: "Miami Heat",
                imgurl: "https://picsum.photos/200/300",
                precio: 128,
                descripcion: "NBA jerseys",
                stock: 7,
            },
    ];
    
    
    return ( 
    <div className="main">
        <div className="card">
            <div className="card-img">
                <img src={imgurl} alt="imagen"></img>
                <div className="card-detail">
                    <h2>{name}</h2>
                    <p>{descripcion}</p>
                    <h3>U$D {precio}</h3>
                    <Button type="alert" text="Comprar"/>
                </div>
            </div>
        </div>
    </div>
    );
}

export default Card;
